@import "component/about-card.scss";
@import "component/footer-card.scss";
@import "component/navbar.scss";
@import "component/sidebar.scss";
@import "utils/reset.scss";
:root{
  scroll-behavior: smooth;
}
::-webkit-scrollbar {
  width: 5px;
  height: 5px;
}
.sidebar{
  box-shadow: 0 2px 10px 0.5px black !important; 
}
.navbar.border-1{
  box-shadow: 0 2px 10px 0.5px black !important;
}
::-webkit-scrollbar-track {
  background: #000000 !important;
  border-radius: 5px;
}

::-webkit-scrollbar-thumb {
  border-radius: 5px;
  background: rgb(205, 203, 203);
}

::-webkit-scrollbar-thumb:hover {
  background: rgb(171, 171, 171);
}

section {
  background-color: var(--color);
  min-height: clamp(300px, 100vh, var(--max-height, 880px));
  display: flex;
  align-items: center;
  justify-content: center;
  position: relative;
  gap: 1rem;

  .container {
    width: min(80rem, 90vw);
    text-align: center;
    display: flex;
    flex-direction: column;
    align-items: center;
    justify-content: center;
    position: relative;
    row-gap: 1rem;
    .nav-button {
      padding: 0.6rem 1rem;
      font-family: "Poppins";
      font-weight: bold;
      background-color: #565656;
      text-decoration: none;
      color: white;
      border: none;
      border-radius: 5px;
      &:active {
        background-color: darken($color: #565656, $amount: 20%);
      }
      &:hover {
        background-color: darken($color: #565656, $amount: 10%);
      }
    }
    &.no-gap {
      row-gap: 0.3rem;
    }
    &.fluid {
      width: min(100rem, 95vw);
    }
    &.large-gap {
      row-gap: 3rem;
    }
    h1 {
      color: var(--text-color, black);
      font-size: 5rem;
    }
    .lead {
      color: var(--text-color, black);
      font-size: 1.1rem;
      font-weight: 300;
      font-family: "Poppins";
    }
  }
  &.circle-bottom::after {
    content: "";
    width: 100%;
    height: var(--radius, 150px);
    display: block;
    position: absolute;
    bottom: -1px;
    background: radial-gradient(
      100vw 100% at bottom,
      var(--next-color, white) 0,
      var(--next-color, white) 55%,
      transparent calc(55% + 5px),
      transparent
    );
  }
  &.circle-top,
  &.cutting-edge {
    padding-bottom: 15rem;
  }
  &.circle-top::after {
    content: "";
    width: 100%;
    height: var(--radius, 150px);
    display: block;
    position: absolute;
    bottom: -1px;
    background: radial-gradient(
      100vw 100% at top,
      transparent 0,
      transparent 55%,
      var(--next-color, white) calc(55% + 5px),
      var(--next-color, white)
    );
  }
  &.cutting-edge::after {
    content: "";
    width: 100%;
    height: var(--radius, 150px);
    display: block;
    position: absolute;
    bottom: -1px;

    background: linear-gradient(
      to left top,
      var(--next-color, white) 50%,
      transparent calc(50% + 3px),
      transparent
    );
  }
}
